$.fn.themeswitcher=function(){$(this).children("*").each(function(){$(this).click(function(){updateCSS($(this).attr("jwtype"),$(this).attr("value"))})})};function updateCSS(b,c){$("link.ui-theme").remove();var a='<link href="'+b+'" rel="stylesheet" type="text/css" class="CSSLink ui-theme">';$("head").append(a);$("body").attr("class",$("body").attr("class")+" "+c)};